INSERT INTO `freeform_feed_messages` VALUES (1,4,'If your site is using any of the default Formatting Templates, you may experience issues where an extra success banner shows in your forms under certain circumstances. Please upgrade to Freeform 3.9.2+ to avoid this potential issue.','[]','warning',1,'2020-11-11 15:09:00','2020-11-11 21:48:00','2021-06-24 17:58:50','02db4a32-3d75-44b1-bbdd-9aa3f9423138'),(2,10,'Freeform 3.9.0 introduced some changes to the included sample Formatting Templates. These changes likely only affect a small number of sites. If any of your forms are 1) using the default example formatting templates, 2) not using AJAX, and 3) you are translating the main success and error banner messages, you may be affected. If all 3 of those conditions apply, please update your language string to be \'Sorry, there was an error submitting the form. Please try again.\' and place it inside the \'site.php\' translation file (instead of \'freeform.php\'). If your site only has 1 language, you can also consider switching to use the new Validation tab approach where the messages can be set inside the form builder per form.','[]','warning',1,'2020-12-02 14:00:00','2020-12-02 17:50:08','2021-06-24 17:58:50','08b60eda-2656-472b-a96f-002a1805198d'),(3,11,'Would you be willing to take a few minutes to complete a survey about your experience with Freeform? We value your feedback and you will also be entered into a draw to win a $100* Amazon gift card! It should only take a couple of minutes and you can remain anonymous if you like. Visit the following link to complete: https://solspace.typeform.com/to/KxJivfHE\n  *For those participants outside the USA, we can provide an Amazon gift card suitable for your country of residence.','[]','info',1,'2020-12-10 14:03:00','2020-12-10 15:50:53','2021-06-24 17:58:50','6e35fe30-ffa9-4b5d-b860-0a7b10564ea1'),(4,12,'The Freeform 3.10 beta is now underway! New features include support for GraphQL, multi-page AJAX, improvements to the Freeform JS plugin, email notifications, and a wide variety of other improvements. Putting exciting but larger updates through rigorous public beta testing is now part of our commitment to providing an even more reliable experience with Freeform! If you\'d like to be a part of the 3.10 beta, please visit the following page for instructions and more details: https://docs.solspace.com/craft/freeform/v3/setup/betas.html','[]','info',1,'2020-12-16 14:03:00','2020-12-16 21:51:27','2021-06-24 17:58:50','75a38512-947f-43dd-90c0-ca6a7588f155'),(5,14,'Freeform 3.10 is now available! New features include support for GraphQL, multi-page AJAX, improvements to the Freeform JS plugin, the Weekly Digest, email notifications, and a wide variety of other improvements.','[]','info',1,'2021-01-06 07:00:00','2021-01-06 07:53:26','2021-06-24 17:58:50','80c8e1e8-3d7d-4f5a-93e4-368d1296c308'),(6,21,'The Freeform 3.11 beta is now underway! New features include support for editing other Craft elements, creation of Calendar Events, ability to update file-based email notification templates directly inside the CP, a full-screen HTML & Twig editor inside the form builder, and refining other areas of Freeform to be more robust. If you\'d like to be a part of the 3.11 beta, please visit the following page for instructions and more details: https://docs.solspace.com/craft/freeform/v3/setup/betas.html','[]','info',1,'2021-02-25 14:03:00','2021-02-25 07:58:14','2021-06-24 17:58:50','f0753d34-52e9-43fa-8ba2-ceb2f9fd28b4'),(7,24,'Freeform 3.11 is now available! New features include the ability to edit other Craft Elements and map to Calendar Events with the Element Connections feature, full-screen HTML & Twig and Rich Text editor inside the form builder, ability to update file-based email notification templates directly inside the CP, support for searching by submissions\' field values in the CP Submissions index, more granular submission viewing and management permissions, ability to lazy load reCAPTCHA scripts, various improvements to the Freeform JS plugin, and a wide variety of other improvements!','[]','info',1,'2021-04-20 06:00:00','2021-04-21 02:26:55','2021-06-24 17:58:50','71afc93e-777f-4f08-9661-4acc35a0d4ae'),(8,25,'Added the ability to edit other Craft Elements, including special support for Craft Users (Pro).','[]','new',1,'2021-04-20 13:00:00','2021-04-22 13:27:02','2021-06-24 17:58:52','dc7bf276-5720-4c46-ac4f-f4584a3ddd71'),(9,25,'Added the ability to map to Calendar Events with the Element Connections feature (Pro).','[]','new',1,'2021-04-20 13:00:00','2021-04-22 13:27:02','2021-06-24 17:58:52','872365e8-dd08-4fc5-8e2a-58f83e8f3794'),(10,25,'Added a full-screen HTML & Twig and Rich Text editor inside the form builder.','[]','new',1,'2021-04-20 13:00:00','2021-04-22 13:27:02','2021-06-24 17:58:52','02e45d1f-5609-4293-91f6-613a019fd1f6'),(11,25,'Added the ability to update file-based email notification templates directly inside the CP (optional). Included a migration tool for migrating from Database to File-based email notifications.','[]','new',1,'2021-04-20 13:00:00','2021-04-22 13:27:02','2021-06-24 17:58:52','66f979ba-31fe-414c-a651-68043da86e48'),(12,25,'Added support for searching by submissions\' field values in the CP Submissions index.','[]','new',1,'2021-04-20 13:00:00','2021-04-22 13:27:02','2021-06-24 17:58:52','1b33d7ac-cbed-413e-ac90-6183ad321e95'),(13,25,'Added more granular submission viewing and management permissions. You can now set read-only permissions in addition to management permissions.','[]','new',1,'2021-04-20 13:00:00','2021-04-22 13:27:02','2021-06-24 17:58:52','b54f08bf-b616-481c-9b87-90c72c6fa985'),(14,25,'Added a setting that allows you to optionally restrict the Forms element field type to only show forms which the user has manage permissions for.','[]','new',1,'2021-04-20 13:00:00','2021-04-22 13:27:02','2021-06-24 17:58:52','3662822f-1826-4ce7-be7d-3fdd9dc4d160'),(15,25,'Added ability to load reCAPTCHA scripts (and checkbox field if using v2 Checkbox) only once the site visitor interacts with the form.','[]','new',1,'2021-04-20 13:00:00','2021-04-22 13:27:02','2021-06-24 17:58:52','dcdd26b6-85ce-4908-bc63-dfae38182cd4'),(16,25,'Added export profile developer events, allowing the addition of custom exporters.','[]','new',1,'2021-04-20 13:00:00','2021-04-22 13:27:02','2021-06-24 17:58:52','061b12dc-e916-404f-a662-6c9f6438991d'),(17,25,'Various improvements to Freeform\'s JS, including optimization to no longer include excess polyfills, no longer fetching field-specific scripts if the fields aren\'t present in the form, loading the JS as a separate \'freeform/plugin.js\' file path, and \'freeform.loadFreeformPlugin()\' to load the JS manually in your template.','[]','new',1,'2021-04-20 13:00:00','2021-04-22 13:27:02','2021-06-24 17:58:52','50efa864-ef9c-4e8c-970a-5e48f889c242'),(18,26,'Freeform 3.11+ introduced changes to how its front-end scripts are inserted into pages (as static URLs). If you have server rules applied to JS and CSS files, you may run into issues. If this is the case, please upgrade to Freeform 3.11.2 immediately, and then switch the behavior back to previous approaches (\'As Files\' introduced in 3.10 or \'Inline\' as it worked previously before 3.10+). This is a new \'Freeform Script Insert Type\' setting available in the General Settings of Freeform 3.11.2 or with Project Config as `scriptInsertType: files`.','[]','warning',1,'2021-04-28 13:00:00','2021-04-28 19:27:41','2021-06-24 17:58:50','edeb48ea-fcc0-4697-84e7-b68e9b0b1a03');
/*!40000 ALTER TABLE `freeform_feed_messages` ENABLE KEYS */;
UNLOCK TABLES;

