@craftcms.com\">accessibility@craftcms.com</a></li>\n<li>GitHub issues: <a href=\"https://github.com/pixelandtonic/spoke-and-chain/issues\">https://github.com/pixelandtonic/spoke-and-chain/issues</a></li>\n</ul><h3>Date</h3>\n<p>This statement was created on 25th April 2021 using the <a href=\"https://www.w3.org/WAI/planning/statements/\">W3C Accessibility Statement Generator Tool</a>.</p>',NULL,NULL),(244,809,1,'2021-05-07 09:14:43','2021-05-07 09:14:43','1d822f52-04c2-44d1-b693-dc6aa29f01f7',0,'<h2>Accessibility Statement for Spoke &amp; Chain</h2>\n<p>Pixel &amp; Tonic, Inc. is committed to ensuring digital accessibility for people with disabilities. We are continually improving the user experience for everyone, and applying the relevant accessibility standards.</p>\n<h3>Conformance status</h3>\n<p>The <a href=\"https://www.w3.org/WAI/standards-guidelines/wcag/\">Web Content Accessibility Guidelines (WCAG)</a> defines requirements for designers and developers to improve accessibility for people with disabilities. It defines three levels of conformance: Level A, Level AA, and Level AAA. Spoke &amp; Chain is partially conformant with WCAG 2.1 level AA. Partially conformant means that some parts of the content do not fully conform to the accessibility standard.</p>\n<h3>Feedback</h3>\n<p>We welcome your feedback on the accessibility of Spoke &amp; Chain.</p>\n<p>Please let us know if you encounter accessibility barriers on Spoke &amp; Chain:</p>\n<ul><li>E-mail: <a href=\"mailto:accessibility@craftcms.com\">accessibility@craftcms.com</a></li>\n<li>GitHub issues: <a href=\"https://github.com/pixelandtonic/spoke-and-chain/issues\">https://github.com/pixelandtonic/spoke-and-chain/issues</a></li>\n</ul><h3>Date</h3>\n<p>This statement was created on 25th April 2021 using the <a href=\"https://www.w3.org/WAI/planning/statements/\">W3C Accessibility Statement Generator Tool</a>.</p>',NULL,NULL),(245,838,1,'2021-07-13 00:21:54','2021-07-13 00:21:54','b40ec035-b1c4-4121-a04